import{_ as t,c as o,o as i,a2 as n}from"./chunks/framework.DDIT__tB.js";const a="/img/setup/intellij-empty-project.png",l="/img/setup/intellij-create-library.png",s="/img/setup/intellij-plugins-location.png",r="/img/setup/intellij-import-module.png",d="/img/setup/intellij-import-eclipse.png",c="/img/setup/intellij-import-cancel.png",u="/img/setup/intellij-dependencies-tab.png",h="/img/setup/intellij-dependency-structure.png",p="/img/setup/intellij-run-configurations-location.png",g="/img/setup/intellij-run-configurations.png",f="/img/setup/intellij-edit-run-templates.png",m="/img/setup/intellij-exclude-classpath.png",y="/img/setup/intellij-excluded-plugins.png",P=JSON.parse('{"title":"Setup Guide for IntelliJ","description":"","frontmatter":{},"headers":[],"relativePath":"wiki/development/intellij.md","filePath":"wiki/development/intellij.md"}'),q={name:"wiki/development/intellij.md"};function w(_,e,j,b,k,I){return i(),o("div",null,e[0]||(e[0]=[n('<h1 id="setup-guide-for-intellij" tabindex="-1">Setup Guide for IntelliJ <a class="header-anchor" href="#setup-guide-for-intellij" aria-label="Permalink to &quot;Setup Guide for IntelliJ&quot;">​</a></h1><h2 id="_1-preparing-the-downloaded-eclipse-product" tabindex="-1">1. Preparing the Downloaded Eclipse Product <a class="header-anchor" href="#_1-preparing-the-downloaded-eclipse-product" aria-label="Permalink to &quot;1. Preparing the Downloaded Eclipse Product&quot;">​</a></h2><p>Download the Plugins for IntelliJ from the <a href="/download/">Download Page</a> and extract the contained files. You should place this folder into a location where it will not be moved, for example your home folder or your program files.</p><h2 id="_2-creating-a-new-project" tabindex="-1">2. Creating a New Project <a class="header-anchor" href="#_2-creating-a-new-project" aria-label="Permalink to &quot;2. Creating a New Project&quot;">​</a></h2><p>First, create a new <strong>empty</strong> IntelliJ project that should contain the project files. The selected file location must not necessarily correspond to the location where you cloned the projects to. <img src="'+a+'" alt="Creating an empty project"></p><p>After you created an empty project, the editor will open up. As our project uses Java 17, set the language level of the project to Java 17. You can do this by entering the project structure using File-&gt;Project Structure in the top bar of the editor.</p><p>Additionally, you will need to set up the downloaded Eclipse product of the data flow analysis as a project library: To do this, navigate to File-&gt;Project Structure and select the Libraries tab in the window. Then, add a new Java project library using the &quot;+&quot; icon. <img src="'+l+'" alt="Creating an empty Java library"> IntelliJ will ask you for a folder that contains the .jar files of the library. Select the <code>plugins</code> folder from the previous step. <img src="'+s+'" alt="The plugin folder location"></p><h2 id="_3-importing-the-data-flow-analysis-into-the-project" tabindex="-1">3. Importing the Data Flow Analysis into the Project <a class="header-anchor" href="#_3-importing-the-data-flow-analysis-into-the-project" aria-label="Permalink to &quot;3. Importing the Data Flow Analysis into the Project&quot;">​</a></h2><p>Now, you need to import the code of the Data Flow Analysis into IntelliJ: For that go to File-&gt;Project Structure then select the Modules tab. After that, select the &quot;+&quot; icon and &quot;Import Module&quot; to import a contained project. <img src="'+r+'" alt="Importing a module"> When IntelliJ asks for the location of the module, select the <code>bundles/org.dataflowanalysis.analysis</code> folder in the cloned git repository. In the following dialogue select Eclipse as external model used during import. <img src="'+d+'" alt="Using the eclipse importer"> If IntelliJ asks for the location of the Eclipse Installation, cancel the dialogue and disregard the following error. <img src="'+c+'" alt="Cancel eclipse instance location dialouge"></p><p>Go back to the Modules tab again, select the imported module, and check whether IntelliJ detected the <code>src</code> folder correctly. You can do this by looking at the Sources panel, selecting the <code>src</code> folder and checking whether the folder is marked as &quot;Sources&quot;.</p><p>Then go to &quot;Dependencies&quot;, and check the structure of the defined dependencies: <img src="'+u+'" alt="Location of the dependencies tab"> The dependencies of a module should have the Project SDK as top entry. If this entry is red, use the &quot;Module SDK&quot; selector, to select the Project SDK. After that should be the module source, followed by dependencies to other imported modules. The external dependency to the eclipse plugins should be last. IntelliJ may add a dependency to an entry named &quot;ECLIPSE&quot;, this entry should be removed. Instead, use the &quot;+&quot; icon to add a dependency to the library created in the second section of the installation. For example, the dependencies of the <code>org.dataflowanalysis.analysis.dfd</code> module should look like this: <img src="'+h+'" alt="Dependency tab layout"></p><p>Repeat this process for the <code>bundles/org.dataflowanalysis.analysis.pcm</code>, <code>bundles/org.dataflowanalysis.analysis.dfd</code> and <code>tests/org.dataflowanalysis.analysis.tests</code> folders. For the <code>tests/org.dataflowanalysis.analysis.tests</code> module, consider marking the <code>src</code> folder as &quot;Tests&quot;. This can be done in the &quot;Modules&quot; tab in File-&gt;Project Settings by first selecting the &quot;Sources&quot; panel. Then select the <code>src</code> folder and use the &quot;Mark As&quot; buttons to mark the folder as &quot;Tests&quot;.</p><h2 id="_4-fixing-the-default-run-configurations" tabindex="-1">4. Fixing the Default Run Configurations <a class="header-anchor" href="#_4-fixing-the-default-run-configurations" aria-label="Permalink to &quot;4. Fixing the Default Run Configurations&quot;">​</a></h2><p>To use the local imported modules, instead of the version of the modules that are provided by the downloaded Eclipse product, some more configuration is needed: First, modify the default run configurations for JUnit and normal applications: For this, go to the top right and select &quot;Current File&quot; and select &quot;Edit Configurations...&quot; to edit the run configurations: <img src="'+p+'" alt="Location of run configurations"><img src="'+g+'" alt="Editing the run configurations"> Then you will need to modify the run configuration templates by selecting &quot;Edit configuration templates...&quot; in the opened window: <img src="'+f+'" alt="Editing the run configuration templates"></p><p>Repeat the following process for both &quot;Application&quot; and &quot;JUnit&quot;: Select the desired run configuration template - so either &quot;Application&quot; or &quot;JUnit&quot; - on the left side in the opened window. Then select &quot;Modify options&quot; and select &quot;Modify classpath&quot; in the &quot;Java&quot; section. In the appearing &quot;Modify classpath&quot; section of the run configuration template, select &quot;+&quot; and &quot;Exclude...&quot; <img src="'+m+'" alt="Adding the classpath option"> Then select <code>org.dataflowanalysis.analysis&lt;SOME_STRING&gt;.jar</code>, <code>org.dataflowanalysis.analysis.dfd&lt;SOME_STRING&gt;.jar</code> and <code>org.dataflowanalysis.analysis&lt;SOME_STRING&gt;.pcm.jar</code> one by one. <img src="'+y+'" alt="Eclipsed plugins"></p><h2 id="_5-checking-the-setup" tabindex="-1">5. Checking the Setup <a class="header-anchor" href="#_5-checking-the-setup" aria-label="Permalink to &quot;5. Checking the Setup&quot;">​</a></h2><p>To check whether you&#39;ve set up our Data Flow Analysis with IntelliJ correctly, navigate to the module <code>org.dataflowanalysis.analysis.tests</code> in the file explorer of the editor. Right-click the <code>src</code> folder and select &quot;Run &#39;All Tests&#39;&quot;. If the project fails to build with numerous errors, it is likely that you did not set up the dependencies of the module correctly. Follow the Section &quot;Importing the Data Flow Analysis into the Project&quot;. if the project fails to build with a small amount of errors, possibly due to a version mismatch, it is likely that you did not set up the run configuration correctly with the modified classpath. Follow the section &quot;Fixing the Default Run Configurations&quot;. If the project runs, but some tests fail, it is likely that you did not set up the run configuration correctly with the modified classpath. Follow the section &quot;Fixing the Default Run Configurations&quot;.</p><h2 id="_6-using-the-analysis" tabindex="-1">6. Using the Analysis <a class="header-anchor" href="#_6-using-the-analysis" aria-label="Permalink to &quot;6. Using the Analysis&quot;">​</a></h2><p>Now that you have setup the analysis locally, you can refer to the guide on running the analysis locally <a href="/wiki/development/running-locally.html">here</a></p>',19)]))}const T=t(q,[["render",w]]);export{P as __pageData,T as default};
